import styled from 'styled-components';
import FilterItem from './filteritem/FilterItem';


const SearchUl = styled.ul`
    background: blue;
    position: absolute;
    top: 10vh;
    width: 60%;
    max-width: 800px;
    margin: 15px auto;
    padding: 10px;
`;

const FilterSearch = (filtered) => {
    return(
        <SearchUl>
            <FilterItem item/>
        </SearchUl>
    )
}

export default FilterSearch;
